
<!DOCTYPE html>

<body>
    <canvas id='canvas' width='744' height='1052'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #layer1

	ctx.rect(120.000000, 52.362183, 565.714290, 625.714290);
	ctx.fill();
	ctx.stroke();
